import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
    height:20px;
    width:30%;
    border:1px solid black;
`;

function Cell({selected, onSelect , key}){

    const onClick = key  => {
        onSelect(key)
    };

    return (
        <Container isSelected={selected} onClick={onClick}/>
    )
}

export default Cell;
